import React from "react";
import './Button.css'

export default props =>
    <button className={`
        button
        ${props.operation ? 'operarion':''}
        ${props.double ? 'double':''}
        ${props.triple ? 'triple' :''}
    `}>
        onClick={e => props.click && props.click(e.target.innerTHML)}
        {props.label}
        </button>
